import Card from '../Card/Card';
import styles from './Cards.module.css'

export default function Cards({ characters, onClose }) {
   return (
      <div className={styles.div}>
         {
            characters.map(({ id, name, status, species, gender, origin, image, }) => {
               return(
                  <Card
                     key={id}
                     id={id}
                     name={name}
                     status={status}
                     species={species}
                     gender={gender}
                     image={image}
                     origin={origin.name}
                     onClose={onClose}
                  />
               )
            })
         }
      </div>
   )
};
